import{_ as e,c as i,o as a,a as r}from"./app.899f69a8.js";const E=JSON.parse('{"title":"快速开始","description":"","frontmatter":{},"headers":[{"level":2,"title":"简介","slug":"简介","link":"#简介","children":[]},{"level":2,"title":"各终端支持访问方式","slug":"各终端支持访问方式","link":"#各终端支持访问方式","children":[]},{"level":2,"title":"IE浏览器（Windows电脑终端）","slug":"ie浏览器-windows电脑终端","link":"#ie浏览器-windows电脑终端","children":[]},{"level":2,"title":"H5浏览器（全终端）","slug":"h5浏览器-全终端","link":"#h5浏览器-全终端","children":[]},{"level":2,"title":"订阅（Windows电脑终端）","slug":"订阅-windows电脑终端","link":"#订阅-windows电脑终端","children":[]},{"level":2,"title":"APP客户端（手机终端、平板终端、MAC电脑终端、Windows电脑终端）","slug":"app客户端-手机终端、平板终端、mac电脑终端、windows电脑终端","link":"#app客户端-手机终端、平板终端、mac电脑终端、windows电脑终端","children":[]},{"level":2,"title":"嵌入式系统（树莓派/瘦客户机终端）","slug":"嵌入式系统-树莓派-瘦客户机终端","link":"#嵌入式系统-树莓派-瘦客户机终端","children":[]}],"relativePath":"index.md","lastUpdated":1673446467000}'),l={name:"index.md"},t=r('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-hidden="true">#</a></h1><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-hidden="true">#</a></h2><p>  涛勰云是涛勰科技自主研发的云教学云办公解决方案，底座采用全自主研发，上层基于微软云桌面。支持包含电脑、手机、平板、树莓派、瘦客户机等全终端设备，同时支持APP客户端、IE浏览器、H5浏览器、订阅等多种方式进行访问。</p><h1 id="第一步" tabindex="-1">第一步 <a class="header-anchor" href="#第一步" aria-hidden="true">#</a></h1><h2 id="各终端支持访问方式" tabindex="-1">各终端支持访问方式 <a class="header-anchor" href="#各终端支持访问方式" aria-hidden="true">#</a></h2><ul><li>Windows电脑终端：IE浏览器，订阅，APP客户端</li><li>MAC电脑终端：APP客户端</li><li>手机终端：APP客户端</li><li>平板终端：APP客户端</li><li>树莓派/瘦客户机终端：嵌入式系统</li><li>H5浏览器本身可以作为独立终端，所以以上设备终端也均支持H5浏览器的方式进行访问</li></ul><h2 id="ie浏览器-windows电脑终端" tabindex="-1">IE浏览器（Windows电脑终端） <a class="header-anchor" href="#ie浏览器-windows电脑终端" aria-hidden="true">#</a></h2><p>  Windows终端可以通过IE浏览器访问，实际是系统自带了“远程桌面连接”APP客户端工具，通过浏览器调用工具打开远程应用或桌面。</p><p>  注意：WinXP和Win7在非局域网环境下并不支持IE浏览器方式访问，请参照H5浏览器。</p><ol><li>打开IE浏览器，地址栏输入<a href="https://tx.cec.cc" target="_blank" rel="noreferrer">https://tx.cec.cc</a>，后端会自动识别转向H4站点，即<a href="https://tx.cec.cc/rdweb/pages/%EF%BC%8C%E8%BE%93%E5%85%A5%E7%94%A8%E6%88%B7%E5%90%8D%E5%92%8C%E5%AF%86%E7%A0%81%E8%BF%9B%E8%A1%8C%E7%99%BB%E5%BD%95%E3%80%82%E7%82%B9%E5%87%BB%E5%BA%94%E7%94%A8%E6%88%96%E6%A1%8C%E9%9D%A2%E5%9B%BE%E6%A0%87%E5%8D%B3%E5%8F%AF%E4%BD%BF%E7%94%A8%EF%BC%9B" target="_blank" rel="noreferrer">https://tx.cec.cc/rdweb/pages/，输入用户名和密码进行登录。点击应用或桌面图标即可使用；</a></li><li>首次登录会提示保存密码，点击“是”，方便下次登陆；</li><li>首次登录还会提示是否运行加载项，点击“允许”，可以实现更佳访问云应用和云桌面体验；</li><li>非同域中电脑首次打开会提示信任发布者提示，勾选“不再询问我是否从此发布者进行远程连接”，可获得更佳的单点访问体验。</li></ol><h2 id="h5浏览器-全终端" tabindex="-1">H5浏览器（全终端） <a class="header-anchor" href="#h5浏览器-全终端" aria-hidden="true">#</a></h2><p>  目前主流的浏览器都支持Html5：360浏览器、Edge、Opera、Chrome、Safari、Firefox等。</p><ol><li>H5浏览器只需输入<a href="https://tx.cec.cc" target="_blank" rel="noreferrer">https://tx.cec.cc</a>，后端会自动识别转向H5站点，即<a href="https://tx.cec.cc/rdweb/webclient%EF%BC%9B" target="_blank" rel="noreferrer">https://tx.cec.cc/rdweb/webclient；</a></li><li>登陆到资源页面可就以访问远程应用和桌面了，部分应用不能支持，可以采用登陆桌面方式进行访问；如果要输入中文，需要点击右上角“设置”按钮，注意切换语言略有不同（单键Shift）；</li><li>点击进入远程应用或桌面，图为H5浏览器的嵌入式访问效果。</li></ol><h2 id="订阅-windows电脑终端" tabindex="-1">订阅（Windows电脑终端） <a class="header-anchor" href="#订阅-windows电脑终端" aria-hidden="true">#</a></h2><ol><li>控制面板打开RemoteApp与桌面连接。</li><li>按照向导输入URL地址：<a href="https://tx.cec.cc" target="_blank" rel="noreferrer">https://tx.cec.cc</a> 或者 <a href="mailto:demo@cec.cc" target="_blank" rel="noreferrer">demo@cec.cc</a>（个人账号）；</li><li>最后就可在开始程序菜单直接访问远程应用和桌面。</li></ol><h2 id="app客户端-手机终端、平板终端、mac电脑终端、windows电脑终端" tabindex="-1">APP客户端（手机终端、平板终端、MAC电脑终端、Windows电脑终端） <a class="header-anchor" href="#app客户端-手机终端、平板终端、mac电脑终端、windows电脑终端" aria-hidden="true">#</a></h2><p>  不同终端系统的APP客户端不同，但大同小异，本示例以Andriod手机为例。首先根据系统点击以下对应的链接进行下载安装；</p><ul><li><a href="https://apps.apple.com/us/app/microsoft-remote-desktop/id1295203466" target="_blank" rel="noreferrer">macOS（MAC）</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod.apk" target="_blank" rel="noreferrer">Andrid（Andriod手机或平板）</a></li><li><a href="https://apps.apple.com/cn/app/microsoft-yuan-cheng-zhuo/id714464092" target="_blank" rel="noreferrer">iOS（iPhone/iPad）</a></li><li>Windows/WP（电脑终端/移动终）：系统自带“远程桌面连接”APP客户端，无需下载</li></ul><ol><li>下载安装好APP后，打开应用，点击右上角的加号，选择“Remote Resource Feed”，Feed URL输入<a href="https://tx.cec.cc" target="_blank" rel="noreferrer">https://tx.cec.cc</a> 或者 <a href="mailto:demo@cec.cc" target="_blank" rel="noreferrer">demo@cec.cc</a>（个人账号），添加个人用户名和密码并保存；</li><li>然后直接点击应用或桌面，下图2展示了手机打开CAD2020的效果；</li><li>移动端的鼠标分Touch和Mouse pointer操作，具体可参照下图。</li></ol><h2 id="嵌入式系统-树莓派-瘦客户机终端" tabindex="-1">嵌入式系统（树莓派/瘦客户机终端） <a class="header-anchor" href="#嵌入式系统-树莓派-瘦客户机终端" aria-hidden="true">#</a></h2><p>  树莓派/瘦客户机终端的嵌入式系统比较复杂，不适合普通用户，主要针对嵌入开发爱好者，这里只做个简单展示。</p><ol><li>左图为树莓派接4K电视屏幕的效果图，手机拍摄颜色失真，实际动静态4K效果都非常不错；当然支持任何电脑显示器，是传统PC台式机的最佳替代品；</li><li>右图为实际树莓派，比一般手机还小，麻雀虽小，五脏俱全。</li></ol>',22),c=[t];function n(d,o,h,s,p,f){return a(),i("div",null,c)}const w=e(l,[["render",n]]);export{E as __pageData,w as default};
